import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';

const dumyList = [{
  id: 1,
  author: "이예나",
  content: "High",
  emotion: 5,
  created_date: new Date().getTime()
  //작성 날짜, 현재 시간을 기준, 숫자 반환
}]

function App() {
  return (
    <div className="App">
      <DiaryEditor />
      <DiaryList />
    </div>
  );
}

export default App;
